import React from "react";
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import Card from "./Card";


const Carousels = () => {
    
  return (
    <div>
      <h1>Card</h1>
      <Carousel >
        <Card />
        <Card />
        <Card />
        <Card />
      </Carousel>
      ;
    </div>
  );
};

export default Carousels;
